import React, {Component} from 'react'
import classes from './App.module.css'

class App extends Component {
    render() {
        return (
            <div className={classes.App}>
                <nav>
                    <ul>
                        <li>
                            <a href="/">HOME</a>
                        </li>
                        <li>
                            <a href="/about">ABOUT</a>
                        </li>
                    </ul>
                </nav>
            </div>
        )
    }
}

export default App;
